import { ModelAnalyticsEvent } from './model-analytics-event';
export class ModelRangeClickEvent extends ModelAnalyticsEvent {
    constructor(analyticsSetup, modelRangeName, series) {
        super(analyticsSetup, modelRangeName);
        this.context.eventAction = 'PAGHomeNav_ModelRange_Click';
        this.populateComponentClick(series);
    }
    populateComponentClick(series) {
        this.componentClick.clickElementId = series.PhraseId;
        this.componentClick.clickElementName = series.Name;
        this.componentClick.clickElementType = 'button';
    }
    event() {
        const car = this.car;
        const componentClick = this.componentClick;
        return Object.assign(Object.assign({}, super.event()), { car,
            componentClick });
    }
}
